function Timer() {
    let [num, setNum]= useState()
  return (
    <>
      <div className="container">
        <h1>0</h1>
        <button>increase</button>
        <button>decrease</button>
        <button>reset</button>
      </div>
    </>
  );
}
export default Timer;
